import {
  Home_Hero,
  Half,
  Customers,
  Overall,
  Popular_Courses,
  Instagram,
  Course_Benefits,
} from "../comps/Portal";
import {
  homeOverall,
  futureAcademy,
  newWays,
  whatWeAre,
} from "../data/Constants";

const Home = () => {
  return (
    <>
      <Home_Hero />
      <Half thing={futureAcademy} />
      <Popular_Courses />
      <lord-icon
        src="https://cdn.lordicon.com/lbjtvqiv.json"
        trigger="hover"
      ></lord-icon>
      <Half thing={newWays} reverse />
      <Course_Benefits />
      <Half thing={whatWeAre} />
      <Instagram />
      <Customers />
      <Overall thing={homeOverall} />
    </>
  );
};

export default Home;
